import React from "react";
import {
  MdOutlineLocalMall,
  MdOutlineFavoriteBorder,
  MdFavoriteBorder,
  MdPermIdentity,
} from "react-icons/md";

import { Link } from "react-router-dom";

function ProductComponent({ image, price, category, type }) {
  //   console.log(props);
  function handleDetail() {
    console.log(alert("Detail Component"));
  }
  function handlewishlist() {
    console.log(alert("wishlist Component"));
  }

  return (
    <div className="div-productcomponent" >
      <Link to={`/${category}/${type}/detailpage`}><div onClick={handleDetail}  >
        <img src={image} alt="" />
        <h4>Brand : Levi's</h4>
        <h4>Size : M</h4>
        <h4>price : {price}</h4>
      </div>
      </Link>
      <button onClick={handlewishlist} >
        <span><MdOutlineFavoriteBorder /></span>
        wishlist
      </button> 
    </div>
  );
}

export default ProductComponent;
